import React, { useState } from "react";
import { Dialog } from "primereact/dialog";
import { InputText } from "primereact/inputtext";
import { Button } from "primereact/button";

const RegistrarCliente = ({ visible, onHide, onRegister }) => {
  const [formData, setFormData] = useState({
    nombre: "",
    correo: "",
    contrasena: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleRegister = () => {
    onRegister(formData); // Llamada para registrar los datos
    setFormData({ nombre: "", correo: "", contrasena: "" }); // Limpiar el formulario
  };

  return (
    <Dialog
      header="Registrar Cliente"
      visible={visible}
      style={{ width: "50vw" }}
      onHide={onHide} // Cerrar el modal
    >
      <div className="p-fluid">
        <div className="field">
          <label htmlFor="nombre">Nombre</label>
          <InputText
            id="nombre"
            name="nombre"
            value={formData.nombre}
            onChange={handleInputChange}
          />
        </div>
        <div className="field">
          <label htmlFor="correo">Correo Electrónico</label>
          <InputText
            id="correo"
            name="correo"
            value={formData.correo}
            onChange={handleInputChange}
          />
        </div>
        <div className="field">
          <label htmlFor="contrasena">Contraseña</label>
          <InputText
            id="contrasena"
            name="contrasena"
            value={formData.contrasena}
            onChange={handleInputChange}
            type="password"
          />
        </div>
        <Button
          label="Registrar"
          icon="pi pi-check"
          className="p-button-success"
          onClick={handleRegister}
        />
      </div>
    </Dialog>
  );
};

export default RegistrarCliente;
